import axios from "axios";
const baseUrl = "http://workbot.jelastic.saveincloud.net/resources/Product";

export async function GetProducts() {
  try {
    const response = await axios(baseUrl);

    console.log(response);
  } catch (error) {
    console.log(error);
  }
}
